import {Box, Grid, Typography, Button } from "@material-ui/core";


export default (props) => {
    return(
        <Box>
            <Grid>
                <Grid item xs>
                    <Typography variant="subtitle1"> FrontEnd Developer</Typography>
                    <Typography variant="subtitle2"> Google</Typography>
                </Grid>
                <Grid item xs>

                </Grid>
                <Grid item xs></Grid>
            </Grid>
        </Box>
    )
}
